import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css";
import Button from "./Button"; 

function Navbar(){
    return (
        <>
        <div className="navbar">
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>sdfsk</li>
            </ul>
        </div>
        </>
    );
}

export default Navbar;
